document.addEventListener("DOMContentLoaded",(function(){let e=document.getElementsByClassName("menu-item-has-block");for(var t=0;t<e.length;t++)e.item(t).onmouseenter=function(){if(this.classList.contains("loaded"))return;this.blockID=this.children[0].getAttribute("data-block");n(this)};const n=e=>{fetch(`${window.location.origin}/wp-json/lazyMenu/UX/block/${e.blockID}`).then((e=>e.json())).then((t=>{e.classList.add("loaded"),e.querySelectorAll(".sub-menu")[0].innerHTML=t.block}))}}));